import { useState } from "react";

const ToggleUserBar = () => {
  const [toggleUserBarValue, setToggleUserBarValue] = useState(false);

  const handleToggleUserBar = (value) => {
    if (typeof value === "boolean") {
      setToggleUserBarValue(value);
    } else {
      setToggleUserBarValue(!toggleUserBarValue);
    }
  };

  return { handleToggleUserBar, toggleUserBarValue };
};

export default ToggleUserBar;
